fn read_vecs_from_file(filepath: &str) -> Result<Vec<Vec<i32>>, Box<dyn std::error::Error>>
{
    let mut test: Vec<Vec<i32>> = vec![];

    let file = File::open(filepath)?;
    let reader = BufReader::new(file);

    for line in reader.lines() {
        let l = line.unwrap();

        let mut temp: Vec<i32> = vec![];
        for s in l.split(" ") {
            temp.push(s.parse::<i32>().unwrap());
        }
        
        test.push(temp);
    }
    
    Ok(test)
}
